import React from 'react';

function TeamPage() {
    return (
        <div style={styles.container}>
            <h1>Здесь статы по командам</h1>
        </div>
    )
}
const styles = {
    container: {
        position:"absolute",
        width:"100%",
        top:"50%",
        textAlign: 'center'
    },
};
export default TeamPage